import React, { Component } from 'react';
import { IoMdMore } from "react-icons/io";
import { Link } from 'react-router-dom'; 
import './Parking.scss';

 class Parking extends Component {


    render(props) {

        //console.log(this.props.params.id);

        function action(id) {
            console.log(id);
            var x = document.getElementById(`${id}`);
            if (x.style.display === "none") {
                x.style.display = "block";
              } else {
                x.style.display = "none";
              }

         };
         function updateParking () {

         };
         function deleteParking (){
            alert('clicked');
         };
         function statusParking(){
            alert('clicked');
         };
         function detailsParking() {
            alert('clicked');
         };

        return (
             <div className="parking" onClick={this.props.clicked}>
                <div className="parking__wrapper">
                    <div className="parking__wrapper_card">
                        <Link to={'/parking-details/' +this.props.id} style={{ textDecoration: 'none' }}><p className="parking__wrapper_card_heading">Parking Title:  <b>{this.props.title}</b> </p></Link>
                        <p className="parking__wrapper_card_icon"> <IoMdMore onClick={() => action(this.props.id) } className="sideIcon" /></p>
                        <p className="parking__wrapper_card_address">Parking Address:   <b>{this.props.address}</b> </p>
                        <p className="parking__wrapper_card_created">Last Created:   <b>{this.props.created}</b> </p>
                        <p className="parking__wrapper_card_update">Parking Verified:   <b>{this.props.verified}</b> </p>

                    </div>
                    <div className="parking__wrapper_action" id={this.props.id}>
                        <div className="parking__wrapper_action_box">
                            <ul className="parking__wrapper_action_box_list">
                                <li onClick={updateParking}>Edit</li>
                                <li onClick={deleteParking}>Delete</li>
                                <li onClick={statusParking}>Update</li>
                                <li onClick={detailsParking}>Details</li>
                            </ul>
                        </div>
                    </div>
                </div>


            </div>
        )
    }
}
export default Parking;
